import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        NUS Bites
        <button> User </button>
        <p>
          Welcome back!
        </p>
      </header>
      <main>
        <h2>What would you like to eat today?</h2>
        <button>Search</button>
        <button>Ranking</button>
        <button>Add new stall</button>
      </main>
    </div>
  );
}

export default App;
